class t{constructor(t){this.id=t.id,this.task=t.todo,this.done=t.completed}render(){return`\n            <article>\n                <h4>${this.task}</h4>\n                <input onclick="Done(${this.id})" type="checkbox" ${this.done?"checked":""}>\n            </article>`}}app.complete=function(t){alert("DONE!")},document.getElementById("todoSection").insertAdjacentHTML("beforeend",(await async function(){const t=await fetch("https://dummyjson.com/todos");return(await t.json()).todos}()).map((e=>new t(e).render())).join(""));
